import React, { useEffect, useState } from 'react';
import Restaurantcard from "./Restaurantcard";
import Shimmer from "./Shimmer";
import { Link } from 'react-router-dom';
import useOnlineStatus from '../utilis/useOnlineStatus';
const Body = () => {
    const [listofRestaurant, setlistofRestaurant] = useState([]);
    const [filterrestaurant, setfilterrestaurant] = useState([]);
    const [SearchText, setSearchText] = useState("");
    useEffect(() => {        
        fetchdata();
    }, []);
    const fetchdata = async () => {
        const data = await fetch("https://www.swiggy.com/dapi/restaurants/list/v5?lat=28.65200&lng=77.16630&is-seo-homepage-enabled=true&page_type=DESKTOP_WEB_LISTING");
        const json = await data.json();
        // console.log(json.data.cards[1].card.card.gridElements.infoWithStyle.restaurants);
        setlistofRestaurant(json.data.cards[1].card.card.gridElements.infoWithStyle.restaurants);
        setfilterrestaurant(json.data.cards[1].card.card.gridElements.infoWithStyle.restaurants);
    } 
    // Conditional Rendering
    const onlinestatus =useOnlineStatus();

if(onlinestatus===false){
   return <h1>You are offline</h1>
}

    if (listofRestaurant.length === 0) {
        return <Shimmer />;
    }

    return (
        <div id="body">
            <div id="search">
                <div> 
                    <input
                        type="text"
                        className="search-box"
                        value={SearchText}
                        onChange={(e) => {
                            setSearchText(e.target.value);
                        }}
                    />
                    <button id="search-btn" onClick={() => {
                        const filterres = filterrestaurant.filter(
                            (res) => res.info.name.toLowerCase().includes(SearchText.toLowerCase())
                        );
                        setfilterrestaurant(filterres);
                    }}>
                        Search
                    </button>
                </div>
                <button
                    id="res_btn"
                    onClick={() => {
                        const filter = filterrestaurant.filter((res) => res.info.avgRating > 4);
                        setfilterrestaurant(filter);
                    }}
                >
                   <span className="bg-blue-500 text-white py-2 px-4 rounded">Top Rated Restaurant</span>
                </button>
            </div>
            <div id="res-container" className='flex flex-wrap'>
                {
                    filterrestaurant.map((restaurant) =><Link to={"/restaurants/"+restaurant.info.id}> <Restaurantcard key={restaurant.info.id} resData={restaurant} /> </Link>)
                }
            </div>
        </div>
    );
}
export default Body;
